import { NOTE_TYPE } from "../data/data";

import Text from "./Text"
import Link from "./Link"

const Note = props => {
    if (props.type === NOTE_TYPE.TEXT) {
        return <Text className="col-md-4" text={props.text} title={props.title}/>
    } else if (props.type === NOTE_TYPE.LINK) {
        return <Link className="col-md-4" text={props.text} url={props.url}/>
    }
}


export default Note;
